import { useRef } from "react";
import { colors } from "../../locales/colors";
import { CartImg } from "../../locales/images/cart";
import { InfoImg } from "../../locales/images/info";
import { MinusImg } from "../../locales/images/minus";
import { PlusImg } from "../../locales/images/plus";
import { ButtonPhoto } from "../../style";

export const FoodPhotoButton = ({ icon, color, onClick, sqr }: any) => {
  function chooseIcon() {
    switch (icon) {
      case "cart":
        return <CartImg color={color} />;
      case "info":
        return <InfoImg color={color} />;
      case "plus":
        return <PlusImg color={color} />;
      case "minus":
        return <MinusImg color={color} />;
      default:
        return null;
    }
  }
  return (
    <ButtonPhoto props={sqr} onClick={onClick}>
      {chooseIcon()}
    </ButtonPhoto>
  );
};
